INSERT INTO `pionera_portal`.`galeria` (`orden`, `nombre`, `referencia`, `descripcion`, `activo`) VALUES ('20', 'Historia', 'HISTORIA', 'En el año de 1959, Don Alfredo Mendoza Pellicer, tuvo la iniciativa de fomentar una pequeña empresa familiar de transporte, conjuntamente con su Sra. Esposa, esto debido a que existía una necesidad de un transporte de la aldea de Mariscos al cruce de Trincheras, ante esta posibilidad la familia Mendoza Pellicer, inicio con una modesta camioneta de 3 asientos, de Mariscos a la aldea de Los Amates y de aldea Mariscos a la Cabecera departamental de Izabal, Puerto Barrios.', '1');
INSERT INTO `pionera_portal`.`galeria` (`orden`, `nombre`, `referencia`, `descripcion`, `activo`) VALUES ('30', 'CLASE ORO GRAN LUJO', 'SERVICIO-BOLETO', 'La flota 2015 de autobuses Clase Oro Gran Lujo, de Transportes Fuente del Norte la Pionera, son una distintiva forma de viajar en Guatemala, una mescla de Confort, Gran Lujo y Esparcimiento, nuestras unidades cuentan con servicio de Wi-Fi para Redes, Servicio con 2 Baños,  Aire Acondicionado,  Luces De Lectura Individual, Monitores con películas en sonido Estéreo con audífonos integrados personalizados, asientos Todo Confort, Planta Alta de 48 asientos y Planta Baja Ejecutiva con 12 asientos de Gran Lujo Semi-cama de Piel, para que mientras usted descansa nosotros lo llevamos hasta su destino, Ventanas Panorámicas, Servicio Eléctrico para recargar su teléfono o Laptop individual por asiento, Servicio de amplitud de Cajuelas de Equipaje, Seguro de Viajero, Control de Velocidad automática, 2 Pilotos Certificados Profesionales, contamos con 3 suspensiones para mayor estabilidad y la Seguridad que usted disfruta al viajar con nosotros. Servicio Clase Oro Gran Lujo, una experiencia diferente de viajar a su altura.', '1');
INSERT INTO `pionera_portal`.`galeria` (`orden`, `nombre`, `referencia`, `descripcion`, `activo`) VALUES ('40', 'MAYA DE ORO GRAN LUJO', 'SERVICIO-BOLETO', 'Buses doble piso del 2015 con servicios de aire acondicionado, televisión con control de audio personalizado, WIFI, asientos semi camas y dos baños.', '0');
INSERT INTO `pionera_portal`.`galeria` (`orden`, `nombre`, `referencia`, `descripcion`, `activo`) VALUES ('50', 'CLASE ORO', 'SERVICIO-BOLETO', 'Los Autobuses Servicio Clase Oro, son ideales para sus viajes de negocios o de placer, cuentan con dos niveles para su mayor comodidad, en la parte superior contamos con  confortables asientos reclinables, luces de lectura individual, mientras que en la parte baja contamos con 9 asientos semi-cama, para que su viaje sea más placentero, Servicio de Aire Acondicionado, Baño, monitores en ambos niveles, con películas selectas y familiares, 2 Pilotos Certificados Profesionales, Seguro de Viajero, amplitud de cajuelas de equipaje, en Servicio Clase Oro su Viaje es cómodo y puntual.', '1');
INSERT INTO `pionera_portal`.`galeria` (`orden`, `nombre`, `referencia`, `descripcion`, `activo`) VALUES ('60', 'MAYA DE ORO', 'SERVICIO-BOLETO', 'Buses con servicios de aire acondicionado, televisión, WIFI y baño.', '0');
INSERT INTO `pionera_portal`.`galeria` (`orden`, `nombre`, `referencia`, `descripcion`, `activo`) VALUES ('70', 'PLATINO', 'SERVICIO-BOLETO', 'El Servicio Platino de Transportes Fuente del Norte La Pionera, es el mismo esmerado servicio que nos distingue, con autobuses modernos y confortables de Primera Clase, con asientos cómodos y reclinables, servicio con aire acondicionado automatizado, luces de lectura individual, ventanas panorámicas, Seguro de Viajera, pilotos certificados profesionales, en Servicio Platino, lo llevamos a su punto de destino con Prontitud, Seguridad y Confort.', '1');
INSERT INTO `pionera_portal`.`galeria` (`orden`, `nombre`, `referencia`, `descripcion`, `activo`) VALUES ('80', 'PREMIER', 'SERVICIO-BOLETO', 'Buses con servicios de aire acondicionado y baño.', '0');
INSERT INTO `pionera_portal`.`galeria` (`orden`, `nombre`, `referencia`, `descripcion`, `activo`) VALUES ('90', 'STARBUS', 'SERVICIO-BOLETO', 'Buses de un nivel con servicios de aire acondicionado, televisión y baño.', '0');
INSERT INTO `pionera_portal`.`galeria` (`orden`, `nombre`, `referencia`, `descripcion`, `activo`) VALUES ('100', 'ECONOMICO', 'SERVICIO-BOLETO', 'Nuestro Servicio Económico de Transportes Fuente del Norte, lo conecta a cualquier punto de Guatemala, con autobuses cómodos y seguros, tenemos presencia en todo el país de frontera a frontera, por eso nuestra empresa pensando en las familias chapinas, le ofrece el servicio de Servicio Económico, para que usted pueda viajar cuidando su economía y la de los suyos, contamos con asientos individuales, seguro de viajero y la seguridad que nos distingue.', '1');
INSERT INTO `pionera_portal`.`galeria` (`orden`, `nombre`, `referencia`, `descripcion`, `activo`) VALUES ('110', 'ENCOMIENDAS', 'SERVICIO-ENCOMIENDAS', 'En nuestro país de Guatemala, los Servicios de Encomienda de Transportes Fuente del Norte, lo acercan cada vez más, ofreciéndole un servicio de paquetería, encomiendas y todo lo que necesitas mandar a los tuyos o tu empresa, en forma segura, honesta, rápida y puntual. Le respaldamos su encomienda con la profesionalidad de más de 55 años de nuestra empresa, nuestros precios son los más bajos de todo Guatemala. Pregunte por nuestros servicios de encomienda, en cualquier estación de Transportes Fuente Del Norte La Pionera.', '1');
INSERT INTO `pionera_portal`.`galeria` (`orden`, `nombre`, `referencia`, `descripcion`, `activo`) VALUES ('120', 'RENTA DE AUTOBUSES O EXCURSIONES', 'SERVICIO-EXCURSIONES', 'Los mejores planes de viajes colectivos, se vuelven una experiencia agradable, rentando un autobús de Transportes Fuente Del Norte La Pionera, nos ajustamos a su presupuesto según sus necesidades, Excursiones escolares, de negocios, de trabajo o de esparcimiento. Contamos con una flota de Autobuses con aire acondicionado, equipados con todo servicio, o económicos según sea su viaje. También contamos con autobuses para rentar, visite a nuestro personal autorizado o contáctenos sin compromiso a los teléfonos 00 (502) 7947 7070, será un gusto atenderles.', '1');
INSERT INTO `pionera_portal`.`galeria` (`orden`, `nombre`, `referencia`, `activo`) VALUES ('130', 'Publicidad', 'PUBLICIDAD', '1');
